        StateHasChanged();
    }

    async void ValidOnSubmit()
    {
        if (searchModel.query.Trim().Length != 0)
        {
            object searchToSubmit = new 
        {
            query = searchModel.query,
            userId = wygrzebSessionData.CurrentUserId
        };

        Console.WriteLine(searchToSubmit);
        
        var json = JsonConvert.SerializeObject(searchToSubmit);
        var data = new StringContent(json, Encoding.UTF8, "application/json");
        Console.WriteLine(await data.ReadAsStringAsync());
        
        var url = "https://localhost:44392/search/new";
        using var client = new HttpClient();

        response = await client.PostAsync(url, data);
        Console.WriteLine("RESPONSE!!!" + await response.Content.ReadAsStringAsync());
        this.articles = JsonConvert.DeserializeObject<List<Article>>(await response.Content.ReadAsStringAsync());
        StateHasChanged();
        }
